import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

export default function NavCenter() {
  return (
    <>
      <CategoryContainer>
        <span>카테고리</span>
      </CategoryContainer>

      <Center>
        <li>
          <NavLink to="/newproduct">신상품</NavLink>
        </li>
        <li>
          <span>베스트</span>
        </li>
        <li>
          <span>알뜰쇼핑</span>
        </li>
        <li>
          <span>특가/혜택</span>
        </li>
      </Center>
    </>
  );
}

export const Center = styled.ul`
  flex: 0 0 0%;
  display: flex;
  list-style-type: none;
  & li {
    display: flex;
    -webkit-box-pack: center;
    justify-content: center;
    width: 150px;
    height: 55px;
    padding-top: 18px;
    line-height: 20px;
    text-align: center;
  }
  & span {
    height: fit-content;
    font-size: 16px;
    font-weight: 500;
    color: rgb(51, 51, 51);
    cursor: pointer;
  }
`;

export const NavLink = styled(Link)`
  text-decoration: none;
  height: fit-content;
  font-size: 16px;
  font-weight: 500;
  cursor: pointer;
  color: rgb(95, 0, 128);
`;

export const CategoryContainer = styled`
  display: flex;
  -webkit-box-align: center;
  align-items: center;
  height: 100%;
  & span{font-size: 16px;
    font-weight: 500;
    line-height: 20px;
    letter-spacing: -0.3px;
    color: rgb(51, 51, 51);
  }
`;
